const Navbar = (props) => {
    return (
        <div className="flex flex-row bg-transparent py-3 px-2">
            <a className="pr-1">Home</a>
            <a className="pr-1">Log in</a>
            <a className="pr-1"></a>

            <button onClick={props.handler}>Dark</button>
        </div>
    );
};

export default Navbar;
